import React, { useState, useEffect } from 'react';
import axios from 'axios';
import employeeService from '../services/employee.service';
import 'bootstrap/dist/css/bootstrap.min.css';

function ParentDataDisplay() {
  const [parentData, setParentData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = () => {
    employeeService
      .viewAllParent()
      .then((response) => {
        console.log(response.data);
        setParentData(response.data);
      })
      .catch((error) => {
        console.log('Something went wrong', error);
      });
  };

  return (
    <div className="container mt-5">
      <h1 className="mb-4">Parent Data</h1>
      <div className="row">
        {parentData.map((parent) => (
          <div key={parent.parentId} className="col-md-4 mb-4">
            <div className="card">
              <div className="card-body">
                <h5 className="card-title">Parent ID: {parent.parentId}</h5>
                <p className="card-text">Email: {parent.email}</p>
                <p className="card-text">Password: {parent.password}</p>
                <p className="card-text">Date of Birth: {parent.dob}</p>
                <p className="card-text">Gender: {parent.gender}</p>
                <p className="card-text">Address: {parent.address}</p>
                <p className="card-text">Mobile No: {parent.mobileNo}</p>
                <p className="card-text">First Name: {parent.pFirstName}</p>
                <p className="card-text">Last Name: {parent.pLastName}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default ParentDataDisplay;
